import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  Typography,
  Button,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  IconButton,
  Modal,
  TextField,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

const Assets = ({ assets, setAssets }) => {
  const [open, setOpen] = useState(false);
  const [newAssetName, setNewAssetName] = useState('');
  const [newAssetTicker, setNewAssetTicker] = useState('');
  const [newAssetPrice, setNewAssetPrice] = useState('');
  const [selectedAsset, setSelectedAsset] = useState(null);

  // Fetch assets from the backend when the component mounts
  useEffect(() => {
    axios.get('http://localhost:5000/assets').then((response) => {
      setAssets(response.data);
    });
  }, [setAssets]);

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleView = (asset) => {
    setSelectedAsset(asset);
    handleOpen();
  };

  const handleAdd = () => {
    const newAsset = {
      name: newAssetName,
      ticker: newAssetTicker,
      price: parseFloat(newAssetPrice),
    };

    axios.post('http://localhost:5000/assets', newAsset).then((response) => {
      setAssets([...assets, response.data]);
    });

    setNewAssetName('');
    setNewAssetTicker('');
    setNewAssetPrice('');
    handleClose();
  };

  const handleRemove = (id) => {
    axios.delete(`http://localhost:5000/assets/${id}`).then(() => {
      setAssets(assets.filter((asset) => asset._id !== id));
    });
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Asset Management
      </Typography>
      <Paper elevation={3} style={{ padding: '16px', marginBottom: '16px' }}>
        <Typography variant="h6">Assets</Typography>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Asset</TableCell>
              <TableCell>Ticker</TableCell>
              <TableCell>Price</TableCell>
              <TableCell>Change %</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {assets.map((asset, index) => (
              <TableRow key={index}>
                <TableCell>{asset.name}</TableCell>
                <TableCell>{asset.ticker}</TableCell>
                <TableCell>${asset.price}</TableCell>
                <TableCell style={{ color: asset.change.startsWith('+') ? 'green' : 'red' }}>
                  {asset.change}
                </TableCell>
                <TableCell>
                  <Button variant="contained" color="primary" onClick={() => handleView(asset)}>
                    View
                  </Button>
                  <IconButton color="error" onClick={() => handleRemove(asset._id)}>
                    <DeleteIcon />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
        <Button variant="contained" color="primary" style={{ marginTop: '16px' }} onClick={handleOpen}>
          Add Asset
        </Button>
      </Paper>

      {/* Modal for Viewing and Adding Assets */}
      <Modal open={open} onClose={handleClose}>
        <Paper elevation={3} style={{ padding: '32px', margin: '50px auto', maxWidth: '600px' }}>
          {selectedAsset ? (
            <>
              <Typography variant="h6" gutterBottom>
                {selectedAsset.name} Details
              </Typography>
              <p>Ticker: {selectedAsset.ticker}</p>
              <p>Price: ${selectedAsset.price}</p>
              <p>Change: {selectedAsset.change}</p>
            </>
          ) : (
            <>
              <Typography variant="h6" gutterBottom>
                Add New Asset
              </Typography>
              <TextField
                label="Asset Name"
                fullWidth
                value={newAssetName}
                onChange={(e) => setNewAssetName(e.target.value)}
                style={{ marginBottom: '16px' }}
              />
              <TextField
                label="Ticker Symbol"
                fullWidth
                value={newAssetTicker}
                onChange={(e) => setNewAssetTicker(e.target.value)}
                style={{ marginBottom: '16px' }}
              />
              <TextField
                label="Price"
                fullWidth
                value={newAssetPrice}
                onChange={(e) => setNewAssetPrice(e.target.value)}
                style={{ marginBottom: '16px' }}
              />
              <Button variant="contained" color="primary" onClick={handleAdd}>
                Add Asset
              </Button>
            </>
          )}
        </Paper>
      </Modal>
    </Container>
  );
};

export default Assets;
